  \"2015-07-08T19:14:56.831092\",\n\t\"name\": \"islscp-ii-global-sea-ice-concentration\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This International Satellite Land Surface
  Climatology Project (ISLSCP) Initiative II data set is based on the Goddard Space
  Flight Center (GSFC) Sea Ice Concentrations from Nimbus-7 Scanning Multichannel
  Microwave Radiometer (SMMR) and the Defense Meteorological Satellites Program (DMSP)
  Special Sensor Microwave/Imager (SSM/I) Passive Microwave Data. This data set contains
  four zip files which includes sea ice concentration (in percentage of ocean area
  covered by sea ice), table data and map data.  These original data were re-gridded
  by the National Snow and Ice Data Center (NSIDC) from their original 25-km spatial
  resolution and EASE-Grid into equal angle Earth grids with quarter, half and one
  degree spatial resolutions in latitude/longitude. The ISLSCP II staff have taken
  the one degree resolution original data provided by the Principal Investigator and
  created global maps of monthly sea ice concentration on a global one degree grid
  using the latitude and longitude coordinates that were provided. Individual monthly
  files were created and written to the ASCII format. The re-gridded one degree original
  data were also adjusted to match the one degree ISLSCP II land/water mask. \",\n\t\"license_title\":
